import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "./App.css";
import GetCountryInfo from "./components/GetCountryInfo";
function App() {
  return (
    <div className="App">
      <GetCountryInfo>
        <Router>
          <Switch>
            <Route exact path="/" />
            <Route exact path="/country/:id" />
          </Switch>
        </Router>
      </GetCountryInfo>
    </div>
  );
}

export default App;
